/**
 * jCheckbox
 */
$.fn.jCheckbox = function(settings) {
    return this.each(function() {
        var $this = $(this),
            checkbox = $this.children("input"),
            type = checkbox.prop("type"),
            icon = $this.children(".checkbox-icon");

        if ( checkbox.is(":checked") ) icon.addClass("active");

        $this.on("click", function(e) {
            e.preventDefault();

            if ( checkbox.prop("checked") ) {
                if (type == "radio") return false;

                icon.removeClass("active");
                checkbox.prop("checked", false).change();
            } else {
                icon.addClass("active");
                checkbox.prop("checked", true).change();

                if (type == "radio") {
                    $this.siblings().find(".checkbox-icon").removeClass("active");
                }
            }
        });
    });
};

